import React from 'react'

interface IProps{
message:string;
wishmsg:string
}
interface IState{

}
class  Props extends React.Component<IProps,IState> 
{
    constructor(props:IProps) {
        super(props)
        
        
        
    }
    render()
    {
        return(
<React.Fragment>
<div className='card'>
    <div className='card-body'>
    <h2>{this.props.message}</h2>
    <h3>{this.props.wishmsg}</h3>
</div>
</div>
</React.Fragment>
        )
    }
}
export default Props
